import numpy as np
import matplotlib.pyplot as plt
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense
from tensorflow.keras.optimizers import Adam
from sklearn.datasets import load_iris
from sklearn.model_selection import train_test_split
from sklearn.preprocessing import OneHotEncoder

iris = load_iris()
print(type(iris))
print('Data shape',iris.data.shape)
print('Label',iris.target.shape)
print(iris)

"""품종이 뭔지는 target에 들어있어."""

import pandas as pd

# Load the Iris dataset
iris = load_iris()

# Create a DataFrame from the Iris dataset
iris_df = pd.DataFrame(iris.data, columns=iris.feature_names)

# Scatter matrix plot with colors based on target variable
scatter_matrix = pd.plotting.scatter_matrix(iris_df, c=iris.target, figsize=(7, 7), marker='o', hist_kwds={'bins': 20}, s=60, alpha=0.8)

# Add labels to the scatter matrix plot
for ax in scatter_matrix.ravel():
    ax.set_xlabel(ax.get_xlabel(), fontsize=8)
    ax.set_ylabel(ax.get_ylabel(), fontsize=8)

plt.show()

iris_df.info()

y=iris.target.reshape(-1,1)
y.shape # 150개 들어있는 거 한 개

y=iris.target.reshape(-1,2)
y.shape # 150개를 2개씩 묶어달라.

y=iris.target.reshape(75,2)
y # 150개를 2개씩 묶어달라.

x =iris.data
y=iris.target.reshape(-1,1)
y.shape # 150개 들어있는 거 한 개

encoder = OneHotEncoder (sparse=False) # (sparse=False) 여기에서 True 와 False는 출력되는 형태가 달라진다. dafault 값이 True이기 때문에 코드에 무조건 적어줘야한다.
encoded_y = encoder.fit_transform(y)
print(encoded_y.shape)
print(encoded_y[:5]) # 앞에 0,1,2,3,4 번까지만 출력해보자.

# 데이터프레임을 가지고 있을때 getdummies를 쓰면 편하다.

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

x_train, x_test, y_train, y_test = train_test_split(x,encoded_y,test_size=0.2)
print(x_train.shape,y_train.shape)
print(x_test.shape,y_test.shape)

model = Sequential()
model.add(Dense(256, input_dim=4,activation='relu')) # relu 얘기 해주세요
model.add(Dense(128, activation='relu')) # relu 얘기 해주세요
model.add(Dense(512,activation='relu'))
model.add(Dense(3,activation='softmax')) # 다중제어기에 ~는 softmax이다.
model.summary()

"""-Dense 레이어를 추가합니다.

-3은 출력 뉴런의 수를 나타내며, 다중 분류 문제에서 클래스의 수와 일치해야 합니다.

-activation='softmax'는 출력층에 적용되는 활성화 함수로, 다중 클래스 분류 문제에서 주로 사용됩니다.

-softmax 함수는 각 클래스에 대한 확률 분포를 생성하여 입력된 샘플을 여러 클래스 중 하나로 분류합니다.

model.add(Dense(3, activation='softmax'))

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

Relu의 모습.

![image.png](data:image/png;base64,)
"""

# 모델 교육 시키기
opt = Adam(lr = 0.001)
model.compile(opt, loss='categorical_crossentropy',metrics=['accuracy'])
fit_hist = model.fit(x_train, y_train,batch_size=30,epochs=20,verbose=1)

"""![image.png](data:image/png;base64,)"""

score =model.evaluate(x_test, y_test,verbose=0)
print('Final test set accuracy:',score[1])

plt.plot(fit_hist.history['accuracy'])
plt.show()

"""![image.png](data:image/png;base64,)

여기서 0.999.. 이거느 setosa 가 맞다는 의미.
0.111.. 이거는 versicolor
0.111 이것은 virginica
"""

labels = iris.target_names
labels

my_sample = np.random.randint(30)
sample= x_test[my_sample]
print('sample data',sample)
sample = sample.reshape(1,4)
print('reshaped data',sample)
pred = model.predict(sample)
print('pred is ',pred)
print('actual is:',y_test[my_sample])
print('Target:',labels[np.argmax(y_test[my_sample])])
print('Prediction after learning is:', labels[np.argmax(pred)])

